function Jewelry({items, onAdd,}) {
    if(items.length <= 0){
        return "loading...."
    } 
    console.log(items)
    const jewels = items.filter((item)=>{
        return(
          (item.category === "jewelery")

        )})
    console.log(jewels);

    return (
        <div className="jewelery-list">
            <div>
                {jewels && jewels.map((jewel, id) => {
                    return (
                        <div className="jewelery" key={id} >
                           <img src={jewel.image} alt="jewelery"/>
                           <h1>{jewel.title}</h1>
                           <h2> $ {jewel.price}</h2>
                           <p><button onClick={onAdd(jewel)}>ADD TO CART</button></p>
                        </div>
                    )
                })}
            </div>
        </div>
    );
}

export default Jewelry;
